  width: 100%;
  height: 50px;
  background-color: red;
`

const Wrapper = styled.div`
    height: 100%;
    padding: 0px 20px;
    display: flex;
    ali
`


const Navbar = () => {
  return (
    <Container>
        <Wrapper>
            div
        </Wrapper>
    </Container>
  )
}

export default Navbar
